INSERT INTO `tools` VALUES (1,'Kill Intransit','0.0.1','In some occasions we have to kill in-transit commands to maintain inventory database integrity.<br>\n		  This tool will set both <b>ALLOC QTY</b> and <b>INTRAN QTY</b> to <b>0</b> and <b>DELETE</b> the command.<br>\n		  Use the fields below to verify the command and its QTY.','kill_intransit','2',NULL,NULL),(2,'Reprint Nike Finds','0.2.1','Enter the container numbers in the field below separated by a <b>NEW LINE</b>. <br>This will download and reprint the Nike Find return labels','reprint_nf','2',NULL,NULL),(3,'Add Bulk Locations','0.5.0',NULL,'add_bulk_locations','2',NULL,NULL);
